import styled from "styled-components";

export const NavbarWrap = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;

  .iconReact, .iconReactNav {
    padding: 2.5rem;
    font-size: 2.5rem;
  }
`;
